import React, { Component } from 'react'
import piano from '../images/piano.jpg'
import movies from '../images/movies.png'
import games from '../images/ps5.png'
import tennis from '../images/tennis.png'

export default class Hobbies extends Component {
  render() {
    return (
      <div>
        <h1>Here's my hobbies</h1>
        <img src={piano} alt="Playing Piano"/>
        <img src={movies} className="App-logo" alt="Watching Movies" />
        <img src={tennis} alt="Playing Tennis" />
        <img src={games} alt="Playing Videogames" />

      </div>
    )
  }
}
